'        apex_json.get_varchar2(''bairro''),',
'        apex_json.get_varchar2(''localidade''),',
'        apex_json.get_varchar2(''uf''),',
'        apex_json.get_varchar2(''unidade''),',
'        apex_json.get_varchar2(''ibge''),',
'        apex_json.get_varchar2(''gia'')',
'    );',
'',
'    COMMIT;',
'EXCEPTION',
'    WHEN OTHERS THEN',
'       :P22_ERROR := SQLERRM;',
'END;'))
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
